webpackJsonp([18552336631677],{2495:function(e,t){e.exports={data:{markdownRemark:{html:'<p>People lean on trees, looking at the birds flying in the sky and the sun looking through the huge thunderhead. Are you waiting for a person at a promised place, or are you taking in some thought?</p>\n<p>For a while, I am addicted to "drawing" with an eraser, this is also one piece. Since the lightiness will come out more beautifully than drawing with a pencil, try using various patterns on your own alone, Suge! Sue! I was impressed. Did everyone do the same? Nee! What?</p>',frontmatter:{cover:null,date:"1997-11-01T00:00:00+09:00",strDate:"1997/10/31",title:"Skies and clouds"}}},pathContext:{path:"/en/blog/1997/11/01-sky/",langKey:"en"}}}});
